import Link from 'next/link';

const TopDrawer = () => {
    <div className="topdrawer">
        <div>
            <Link href="/">
                <a>Home</a>
            </Link>
            <Link href="/projects">
                <a>Projects</a>
            </Link>
        </div>  
        <style jsx>{`
        .topdrawer {
            width: 100%;
            background: red;
        }
        
        `} </style>
    </div>  
    
};

export default TopDrawer;
